#define iTime iTime
#define iResolution iResolution

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
	vec2 st = fragCoord.xy / iResolution.xy;
	vec3 color = vec3(0.0);

	color.r = sin(iTime + st.y * 20.0) * 0.5 + 0.5;
	color.g = sin(iTime + st.x * 20.0) * 0.5 + 0.5;
	color.b = sin(iTime + (st.x + st.y) * 10.0) * 0.5 + 0.5;

	fragColor = vec4(color, 1.0);
}
